def learn_all(a):  

  exp = jnp.pow(b[k:].reshape(k,1),times)
  # y = activation*exp*(a[:k].reshape(k,1))
  y = activation*exp*((a[:k].reshape(k,1))**2)
  y = jnp.sum(y,0)


  energy = jnp.linalg.norm(y)
  energy_80ms = jnp.linalg.norm(y[:80*48])
  energy_50ms = jnp.linalg.norm(y[:50*48])

  definition = energy_50ms/energy
  definition_loss = (target_definition - definition)**2

  simplified_clarity = energy_80ms/energy
  clarity_loss = (target_simplified_clarity - simplified_clarity)**2

  center_time = jnp.sum(y*y*jnp.arange(n))/energy
  center_time_loss = (target_center_time - center_time)**2
  
  # t30_loss = (target_t30- t30)**2

  ld = 10000
  lcl = 10000000
  lct = 0.000002

  return ld*definition_loss + lcl*clarity_loss + lct*center_time_loss





